import React from 'react';
import { Link } from 'react-router-dom';

const NavLink = ({ to, icon: Icon, text }) => {
  return (
    <Link to={to} className="flex items-center space-x-1 text-gray-700 hover:text-orange-500">
      {Icon && <Icon size={20} />}
      <span>{text}</span>
    </Link>
  );
};

export default NavLink;
